INSERT INTO `v1_4b5567d058c6e49378a94fd5611e290f31066e75b9ac3dd1e16e76ff00db89cf` VALUES ("加速", "【加速】", "ＴＰ回復や行動速度アップにより、キャラのスキルやユニオンバーストの発動数が増加する\n", 1);
INSERT INTO `v1_4b5567d058c6e49378a94fd5611e290f31066e75b9ac3dd1e16e76ff00db89cf` VALUES ("弱体", "【弱体】", "敵に継続ダメージ系状態異常や弱体効果を付与し、敵を弱体化させる\n", 2);
INSERT INTO `v1_4b5567d058c6e49378a94fd5611e290f31066e75b9ac3dd1e16e76ff00db89cf` VALUES ("会心", "【会心】", "クリティカルや通常攻撃強化により、攻撃性能を強化する\n", 3);
INSERT INTO `v1_4b5567d058c6e49378a94fd5611e290f31066e75b9ac3dd1e16e76ff00db89cf` VALUES ("強化", "【強化】", "攻撃力や防御力アップのバフ効果を用いて、キャラを強化する\n", 4);
INSERT INTO `v1_4b5567d058c6e49378a94fd5611e290f31066e75b9ac3dd1e16e76ff00db89cf` VALUES ("守備", "【守備】", "ＨＰアップやバリア展開により、耐久性能を強化する\n", 5);
